import { api } from '../App'
function Form() {

    async function createUser() {
        let res = await api.post('/', { id: 6, first_name: 'sagar', last_name: 'chhatbar', email: 'sagar@gmail.com' }).catch(err => console.log(err))
        console.log(res);
      }

  return (
    <div>
        <form>
            <input type='text' placeholder='first name'/>
            <input type='text' placeholder='last name'/>
            <input type='email' placeholder='email'/>

        </form>
        <button onClick={createUser}>create user</button>

    </div>
  )
}

export default Form
